result:
query{
  marcas: allContentfulPartners(sortBy: "title" , order: ASC){
    edges{
      node{
        title
        id
        cloudinaryImage{
          secure_url
        }
      }
    }
  }

  posts: allContentfulPost (sortBy: "date", order: DESC) {
    edges{
      node{
        slug
        title
        descripcion
        imagenPortada{
          secure_url
        }
      }
    }
  }

}
